[Form]
public class InventQuarantineOrder extends FormRun
{
    [FormObservable]
    NoYes                               showComplete;
    QueryBuildRange                     criteriaComplete;

    InventDimCtrl_Frm_Mov_Quarantine    inventDimFormSetup;

    NumberSeqFormHandler                numberSeqFormHandler;

    PdsCWFormCtrl                       cwFormCtrl;

}

void close()
{
    if (numberSeqFormHandler)
    {
        numberSeqFormHandler.formMethodClose();
    }

    super();
}

void doFormCache(container _packRecs)
{
    RunBaseMultiParmApplication::formCacheAll(_packRecs,element,inventQuarantineOrder,true,inventDim);

    if (InventParameters::find().UseQualityManagement)
    {
        // Force a refresh of the qualityOrderStatusDisplay display method
        inventQuarantineOrder_ds.reread();
    }
    else
    {
        inventQuarantineOrder_ds.active();
    }
}

void doReread()
{
    inventQuarantineOrder_ds.reread();
    inventQuarantineOrder_ds.refresh();
    inventQuarantineOrder_ds.active();
}

void doResearch()
{
    inventQuarantineOrder_ds.research();
}

void hideQualityManagement()
{
    qualityOrderStatusDisplay.visible(false);
    InventQualityOrderTable.visible(false);
}

void init()
{
    if (#PdsCatchWeightEnabled)
    {
        cwFormCtrl = PdsCWFormCtrl_InventQuarantineOrder::newFromForm(element);
        cwFormCtrl.initPre();
    }

    super();

    element.updateDesign(InventDimFormDesignUpdate::Init);

    if (!InventParameters::find().UseQualityManagement)
    {
        element.hideQualityManagement();
    }

    if (cwFormCtrl)
    {
        cwFormCtrl.parmBuffer(inventQuarantineOrder);
        cwFormCtrl.initPost();
    }
}

Object inventDimSetupObject()
{
    return inventDimFormSetup;
}

NumberSeqFormHandler numberSeqFormHandler()
{
    if (!numberSeqFormHandler)
    {
        numberSeqFormHandler = NumberSeqFormHandler::newForm(InventParameters::numRefQuarantineId().NumberSequenceId,
                                                             element,
                                                             inventQuarantineOrder_DS,
                                                             fieldNum(InventQuarantineOrder,QuarantineId)
                                                            );
    }
    return numberSeqFormHandler;
}

void setFieldReturnAccess()
{
    boolean showReturn;

    showReturn = inventQuarantineOrder.hasReturnOrderReference();
    returnGroup.enabled(showReturn);
    inventQuarantineOrder_ds.object(fieldNum(InventQuarantineOrder, ReturnDispositionCodeId)).
        enabled(showReturn && (inventQuarantineOrder.Status == InventQuarantineStatus::Started));
}

edit NoYes showComplete(boolean set, NoYes _showComplete)
{
    if (set)
    {
        showComplete = _showComplete;
        inventQuarantineOrder_ds.executeQuery();
    }
    return showComplete;
}

void updateDesign(InventDimFormDesignUpdate mode)
{
    InventMovement localMovement = InventMovement::construct(inventQuarantineOrder);

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init           :
            showComplete = NoYes::No;
            if (element.args() && element.args().caller() && element.args().dataset())
            {
                showComplete = NoYes::Yes;
            }

            if (!inventDimFormSetup)
            {
                inventDimFormSetup  = InventDimCtrl_Frm_Mov_Quarantine::newFromFormMovement(element,localMovement);
            }
            inventDimFormSetup.parmSkipOnHandLookUp(true);

        // do continue
        case InventDimFormDesignUpdate::Active         :
            inventDimFormSetup.formActiveSetup(localMovement.inventDimGroupSetup(),localMovement);
            inventDimFormSetup.formSetControls(true);
            break;

        case InventDimFormDesignUpdate::FieldChange    :
            inventDimFormSetup.formActiveSetup(localMovement.inventDimGroupSetup(),localMovement);
            inventDimFormSetup.formSetControls(true);
            break;

        default : throw error(strFmt("@SYS54195",funcName()));
    }
}

public void reread()
{
    super();
    this.active();
}

public boolean validateWrite()
{
    boolean ret;

    inventQuarantineOrder.setFromFormWrite(inventDim,inventDimQuarantine);

    ret = super();

    ret = element.numberSeqFormHandler().formMethodDataSourceValidateWrite(ret) && ret;

    if (cwFormCtrl)
    {
        ret = cwFormCtrl.dataSourceValidateWrite() && ret;
    }

    return ret;
}

void linkActive()
{
    element.numberSeqFormHandler().formMethodDataSourceLinkActive();
    super();

    if (cwFormCtrl)
    {
        cwFormCtrl.dataSourceActivePost();
    }
}

void executeQuery()
{
    if (showComplete)
    {
        criteriaComplete.value('');
    }
    else
    {
        criteriaComplete.value(strFmt('!%1', queryValue(InventQuarantineStatus::Ended)));
    }

    super();

    buttonGroup.enabled(inventQuarantineOrder.QuarantineId != '');
}

void init()
{
    super();

    this.query().dataSourceTable(tableNum(InventQuarantineOrder)).addSortField(fieldNum(InventQuarantineOrder,QuarantineId));
    criteriaComplete = this.query().dataSourceTable(tableNum(InventQuarantineOrder)).addRange(fieldNum(InventQuarantineOrder,Status));

    inventQuarantineOrder_ds.cacheAddMethod(tableMethodStr(InventQuarantineOrder, qualityOrderStatusDisplay));

    if (cwFormCtrl)
    {
        cwFormCtrl.dataSourceInitPost(inventQuarantineOrder);
    }
}

void delete()
{
    ttsbegin;

    element.numberSeqFormHandler().formMethodDataSourceDelete();

    super();

    ttscommit;
    buttonGroup.enabled(false);
}

void create(boolean append = false)
{
    inventQuarantineOrder_QuarantineId.setFocus();

    element.numberSeqFormHandler().formMethodDataSourceCreatePre();

    super(append);

    element.numberSeqFormHandler().formMethodDataSourceCreate();
}

void write()
{
    InventMovement::bufferSetRemainQty(inventQuarantineOrder);

    ttsbegin;

    inventQuarantineOrder.setFromFormWrite(inventDim,inventDimQuarantine);

    super();

    element.numberSeqFormHandler().formMethodDataSourceWrite();

    if (inventQuarantineOrder.InventDimId != inventDim.InventDimId)
    {
        inventDim.data(InventDim::find(inventQuarantineOrder.InventDimId));
        inventDim_ds.setCurrent();
    }

    if (inventQuarantineOrder.InventDimIdQuarantine != inventDimQuarantine.InventDimId)
    {
        inventDimQuarantine.data(InventDim::find(inventQuarantineOrder.InventDimIdQuarantine));
        inventDimQuarantine_ds.setCurrent();
    }

    ttscommit;
}

int active()
{
    int ret = super();

    element.updateDesign(InventDimFormDesignUpdate::Active);

    inventDim_DS.active();
    inventDimQuarantine_DS.active();

    inventQuarantineOrder_ds.object(fieldNum(InventQuarantineOrder,Qty)).allowEdit(inventQuarantineOrder.Status == InventQuarantineStatus::Created);
    inventQuarantineOrder_ds.allowEdit(inventQuarantineOrder.Status != InventQuarantineStatus::Ended);
    inventDim_ds.allowEdit(inventQuarantineOrder.Status == InventQuarantineStatus::Created);
    inventDimQuarantine_ds.allowEdit(inventQuarantineOrder.Status == InventQuarantineStatus::Created);
    functionsButton.enabled(inventQuarantineOrder.Status != InventQuarantineStatus::Ended);
    reserveButton.enabled(inventQuarantineOrder.Status != InventQuarantineStatus::Ended);
    registerButton.enabled(inventQuarantineOrder.Status != InventQuarantineStatus::Ended);
    pickButton.enabled(inventQuarantineOrder.Status != InventQuarantineStatus::Ended);

    startUp.enabled(inventQuarantineOrder.Status == InventQuarantineStatus::Created);
    reportFinished.enabled(inventQuarantineOrder.Status == InventQuarantineStatus::Started);
    end.enabled(inventQuarantineOrder.Status == InventQuarantineStatus::Started ||
                inventQuarantineOrder.Status == InventQuarantineStatus::ReportedFinished);

    element.setFieldReturnAccess();

    buttonGroup.enabled(inventQuarantineOrder.QuarantineId != '');

    if (cwFormCtrl)
    {
        cwFormCtrl.dataSourceActivePost();
    }

    return ret;
}

void modified()
{
    super();

    inventDim.data(InventDim::find(inventQuarantineOrder.InventDimId));
    inventDimQuarantine.data(inventDim);
    inventDimQuarantine.InventLocationId = InventLocation::find(inventDim.InventLocationId).InventLocationIdQuarantine;

    element.updateDesign(InventDimFormDesignUpdate::FieldChange);

    if (cwFormCtrl)
    {
        cwFormCtrl.fieldModified(fieldNum(InventQuarantineOrder, ItemId));
    }

    InventDim_DS.refresh();
    InventDimQuarantine_DS.refresh();
}

