boolean validate()
{
    boolean ret = true;

    InventLocationType  inventLocationType = InventLocation::find(inventDim.InventLocationId).InventLocationType;
    if (inventLocationType == InventLocationType::Quarantine || inventLocationType == InventLocationType::Transit)
    {
        ret = checkFailed(strFmt("@SYS58479", inventLocationType));
    }

    ret = super() && ret;

    return ret;
}

