boolean validate()
{
    boolean ret = true;

    if (InventLocation::find(inventDimQuarantine.InventLocationId).InventLocationType != InventLocationType::Quarantine)
    {
        ret = checkFailed(strFmt("@SYS58480",InventLocationType::Quarantine));
    }

    ret = super() && ret;

    return ret;
}

void clicked()
{
    boolean             returnQuarantine    = inventQuarantineOrder.hasReturnOrderReference() == NoYes::Yes;
    boolean             returnReplacement   = false;

    inventQuarantineOrder_Split.enabled(inventQuarantineOrder.RecId
                                    && (inventQuarantineOrder.Status    == InventQuarantineStatus::Created
                                    ||  inventQuarantineOrder.Status    == InventQuarantineStatus::Started));

    inventQuarantineOrder_Scrap.enabled(inventQuarantineOrder.RecId
                                    && !returnQuarantine
                                    && (inventQuarantineOrder.Status    == InventQuarantineStatus::Created
                                    ||  inventQuarantineOrder.Status    == InventQuarantineStatus::Started));

    returnReplacement = returnQuarantine && ReturnDispositionCode::find(inventQuarantineOrder.ReturnDispositionCodeId).createReplacement();
    returnReplaceItem.enabled(returnReplacement);

    super();
}
